//this groovy script collects the values of the attribute 
//BP_Plan.verfahren for each BP_Bereich.id

withTransformationContext {
	def c = _.context.collector(it)
	
	def bereichId = _source.p.id.value()
	def verfahren = _source.links.BP_Plan.p.verfahren.value()
	
	c.bereichId_verfahren[bereichId] << verfahren
}

//this groovy script assigns the collected values
//of collector 'bereichId_verfahren'

withTransformationContext{
	def c = _.context.collector(it)
	verfahren = c.bereichId_verfahren[id].value()
}
return verfahren

def inputTyp = typ

if (typ) {
	if (inputTyp == '3000') { // GehFahrrecht
		return ['1000', '2000']
	}
	else if (inputTyp == '4100') { // GehLeitungsrecht 
		return ['1000', '4000']
	}
	else if (inputTyp == '4200') { // FahrLeitungsrecht 
		return ['2000', '4000']
	}
	else if (inputTyp == '5000') { // GehFahrLeitungsrecht 
		return ['1000','2000', '4000']
	}
	else {
		return inputTyp;
	}
}

if (referenzURL) {
	return referenzURL
}
else if (referenzName) {
	return referenzName
}
else {
	return 'Unbekannt'
}

